import "./NavBar.css";

//Componentes
import { NavLink, Link } from "react-router-dom";
import {
  BsSearch,
  BsHouseDoorFill,
  BsFillPersonFill,
  BsFillCameraFill,
} from "react-icons/bs";

const NavBar = () => {
  return (
    <nav id="nav">
      <Link to="/">ReactGram</Link>
      <form id="search-form">
        <BsSearch />
        <input type="text" placeholder="Pesquisar" />
      </form>
      <ul id="navlinks">
        <li>
          <NavLink to={"/"}>
            <BsHouseDoorFill />
          </NavLink>

          <NavLink to={"/login"}>Entrar</NavLink>

          <NavLink to={"/register"}>Cadastrar</NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
